LayerData.variable:
Asynchronous Notification is the mechanism whereby a State Machine can inform its invoking State Machine of noteworthy events encountered during its execution.

The caller word invokes the desired State Machine start state word, then uses the returned taskId to install an Anr word through which it is to be notified of evnets. It optionally can also install a generic value that will be available inside the Anr word that may be of use to distinguish between multiple concurrent sub-machines all using the same Anr word. For example:

: DoData puts cr ;
: DoDone "Sub Machine Completed" puts cr ST_WAKE Sleep ;
: MyAnr dup kData     = if DoData then
        dup kComplete = if DoDone then ;
: aCallerDone ." I've been woken up again!" cr 0 NextWord;
: aCallerState ...
   Self argument %5B'%5D SubTask RunWord %5B'%5D MyAnr swap SetTaskAnr 
   %5B'%5D aCallerDone NextWord ST_SLEEP Sleep ;

The callee word (or any of its subsequent state words) can then invoke its caller Anr word at any time using the syntax for eaxample:

: SubDone kComplete DoAnr drop 0 NextWord;
: SubTask "Data for my Caller" kData DoAnr drop %5B'%5D SubDone NextWord ;

You may elect to have your interface make use of the return value from DoAnr to control the callee task. Note that the stack mechanism means you can also elect to pass additional information on the stack in either direction. Just be sure to document your interface thoroughly.

Script.Text:
( This is an example of a two-state machine that runs forever. It wakes twice a second and runs its value up or down, depending on which state it is in.
At hard coded limits it will switch state to reverse the counter direction. )
( this is how to get around no forward refs ) defer CountingUpFwd
: CountingDown ( -- ) ( this words run as a State machine ) ATimedCounter.var v@ 1- dup 1 %3C if %5B'%5D CountingUpFwd NextWord then ATimedCounter.var v!! 1 Seconds 2 / Sleep ;
: CountingUp ( -- ) ( this words run as a State machine ) ATimedCounter.var v@ 1+ dup 1f %3E if %5B'%5D CountingDown NextWord then ATimedCounter.var v!! 1 Seconds 2 / Sleep ;
( initialise the State machine at compile time ) ' CountingUp is CountingUpFwd
: stat_counter_demo 0 0 %5B'%5D CountingUp RunWord drop ;

